import React, { useState, useEffect } from 'react';
import {
  Container, Typography, TextField, Button, List, ListItem, ListItemText,
  Checkbox, IconButton, Box, Paper
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DeleteIcon from '@mui/icons-material/Delete';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';

// Custom styled components
const ModernPaper = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(3),
  borderRadius: '12px',
  boxShadow: '0 8px 24px rgba(0, 0, 0, 0.1)',
  background: '#fff',
  maxWidth: 600,
  margin: '0 auto',
}));

const AddButton = styled(Button)(({ theme }) => ({
  borderRadius: '25px',
  padding: theme.spacing(1, 3),
  background: 'linear-gradient(90deg, #ff6f61 0%, #ff8e53 100%)',
  color: '#fff',
  fontWeight: 600,
  '&:hover': {
    background: 'linear-gradient(90deg, #ff8e53 0%, #ff6f61 100%)',
  },
}));

const TodoItem = styled(ListItem)(({ theme, completed }) => ({
  background: completed ? '#f0f0f0' : '#fafafa',
  borderRadius: '8px',
  margin: theme.spacing(1, 0),
  transition: 'all 0.3s ease',
  '&:hover': {
    boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)',
  },
}));

function TodoList() {
  const [todos, setTodos] = useState([]);
  const [title, setTitle] = useState('');
  const userId = localStorage.getItem('userId');
  const navigate = useNavigate();

  useEffect(() => {
    if (!userId) {
      navigate('/login');
    } else {
      fetchTodos();
    }
  }, [userId, navigate]);

  const fetchTodos = async () => {
    const response = await axios.get('http://localhost:8080/api/todos', {
      headers: { 'User-Id': userId },
    });
    setTodos(response.data);
  };

  const addTodo = async () => {
    if (title) {
      await axios.post('http://localhost:8080/api/todos', { title, completed: false }, {
        headers: { 'User-Id': userId },
      });
      setTitle('');
      fetchTodos();
    }
  };

  const toggleTodo = async (todo) => {
    await axios.put(`http://localhost:8080/api/todos/${todo.id}`, { ...todo, completed: !todo.completed }, {
      headers: { 'User-Id': userId },
    });
    fetchTodos();
  };

  const deleteTodo = async (id) => {
    await axios.delete(`http://localhost:8080/api/todos/${id}`, {
      headers: { 'User-Id': userId },
    });
    fetchTodos();
  };

  return (
    <Container sx={{ py: 6, background: '#f5f7fa', minHeight: '100vh' }}>
      <motion.div initial={{ opacity: 0 }} animate={{ opacity: 1 }} transition={{ duration: 0.5 }}>
        <ModernPaper elevation={4}>
          <Typography variant="h3" align="center" gutterBottom sx={{ color: '#ff6f61', fontWeight: 700 }}>
            Your Todos
          </Typography>
          <Box sx={{ display: 'flex', mb: 3 }}>
            <TextField
              label="Add a task"
              fullWidth
              variant="outlined"
              value={title}
              onChange={(e) => setTitle(e.target.value)}
              sx={{
                '& .MuiOutlinedInput-root': {
                  borderRadius: '25px',
                  background: '#f9f9f9',
                  '& fieldset': { borderColor: '#ddd' },
                  '&:hover fieldset': { borderColor: '#ff6f61' },
                },
              }}
            />
            <AddButton variant="contained" sx={{ ml: 2 }} onClick={addTodo}>
              Add
            </AddButton>
          </Box>
          <List>
            {todos.map((todo) => (
              <TodoItem key={todo.id} completed={todo.completed} component={motion.li} initial={{ x: -20 }} animate={{ x: 0 }}>
                <Checkbox checked={todo.completed} onChange={() => toggleTodo(todo)} sx={{ color: '#ff6f61', '&.Mui-checked': { color: '#ff6f61' } }} />
                <ListItemText primary={todo.title} sx={{ color: todo.completed ? '#888' : '#333', textDecoration: todo.completed ? 'line-through' : 'none' }} />
                <IconButton edge="end" onClick={() => deleteTodo(todo.id)} sx={{ color: '#ff6f61' }}>
                  <DeleteIcon />
                </IconButton>
              </TodoItem>
            ))}
          </List>
        </ModernPaper>
      </motion.div>
    </Container>
  );
}

export default TodoList;
